:root{
  --color-primary:#2584ff;
  --color-secondary:#00d9ff;
  --color-accent:#ff3400;
  --color-headings: #1b0760;
  --color-body:#918ca4;
}
/*Topography*/
html{
  font-size: 62.5%;
}
h1,h2,h3{
  color: var(--color-headings);
  margin-bottom: 1rem;
}
h1{
  font-size: 7rem;
}
h3{
  font-size: 3rem;
}
p{
  margin-top: 0;
}
body{
font-family: "Inter", Arial, Helvetica, sans-serif;
color: var(--color-body);
font-size: 2.4rem;
line-height: 1.5;
}
/*links*/
a{
  text-decoration: none;
}
.link-arrow{
  color: var(--color-accent);
  font-size: 2rem;
  text-transform: uppercase;  font-weight: bold

}

.link-arrow::after{
  content: "-->";
  margin-left: 5px;
  transition: margin 0.15s;
}
.link-arrow:hover::after{
  margin-left: 10px;

}
/*badges*/
.badge{
  font-weight: 600;
  font-size: 2rem;
  border-radius: 2rem;
  padding: 0.5rem 2rem;
  white-space: nowrap;
  color: white;
}
.badge-primary{
  background-color: #126de4;


}
.badge-secondary{
  background-color: #02cdf1;
}
.badge-small{
  font-size: 1.6rem;
}
/*lists*/
.list{
  font-size: 2.4rem;
  list-style-type: none;
  padding-left: 0;
  color: var(--color-headings);
}
.list-inline .list_item{
  display: block;
  margin-right: 2rem;
}

.list-tick {
  list-style-image: url(../images/tick.svg);
  padding-left: 3rem;
}
.list-tick .list_item{
  padding-left: 0.5rem;
  margin-bottom: 1rem;}

  /*icons*/
.icon{
    width: 5rem;
    height: 5rem;
  }
.icon-primery{
    fill: var(--color-primary);
    padding: 0.5rem;
 
  }
.icon-container{
    background-color:  #f3f9fa;
    display:inline-flex;  
    border-radius: 100%;
    justify-content: center;
    align-items: center;
    width: 6.4rem;
    height: 6.4rem;
    }

    /*buttons*/
    *,*::after,*::before{
      box-sizing: border-box;
    } /*ova e za a href da bide 100% width kako buttonite*/
.btn{
  border-radius: 5rem;
  border: 0;
  color: white;
  font-size: 1.8rem;
  font-weight: 600;
  margin: 0.5rem 0;
  outline: 0;
  padding: 2rem 4vw;
  text-align: center;
  text-transform: uppercase;
  white-space: nowrap;
}
.btn-secondary{
  background-color: var(--color-secondary);
  
}
.btn .btn-search{
  fill: white;
  height: 2rem;
  width: 2rem;
  margin-right: 1rem;
  vertical-align: middle;
 
}
.btn-accent{
  background-color: var(--color-accent);
}
.btn-border{
  background-color: white;
  border: 0.2rem solid var(--color-headings);
  color: var(--color-headings);
}
.btn-block{
  flex-grow: 1;
  width: 0%;
  font-size: 1.5rem;
}
.button-btn{
  display: flex;
  width: 100%;
}
.btn-border:hover{
  background: var(--color-headings);
  color: white;
}
.btn-accent:hover{
  background-color: #fa491b;
}
.btn-secondary:hover{
  background-color:#4ae2fd ;}
/*input*/
.input{
  border: 0.1rem solid lightgray;
  width: 100vw;
  border-radius: 5rem;
  padding: 2rem 4rem;
  color: var(--color-headings);
  outline: 0;
  font-size: 2rem;
}
::placeholder{
  color:#cdcbd7; 
  padding-left: 3rem;
}
.input-group{
  width: 100%;
  padding: 0 0.5rem;
  display: flex;
  box-shadow: 0 0 30px 10px lightgray;
  border: 0;
  
}
.btn-input{

  border: 0;
  border-radius: 5rem;
 
  padding-left: 3rem;
  outline: 0;
  font-size: 1.5rem;
}
/*cards*/
.card{
  width: auto;
  display: flex;
  flex-direction: column;
  box-shadow: 0 0 50px 20px grey;
  overflow: hidden;
  padding: 4rem;
 
  
}
.card .list-tick{
  padding: 4rem;
  margin: 0;
  
}

.card .btn-border{
  margin:2rem;
}

.card-header{
  background-color: var(--color-secondary);
  color: white;
   padding: 3rem 3.5rem 1rem 3.5rem;
}
  
.card .card-primary{
 background-color: var(--color-primary);
}
.card-header{
  position: relative;
} 
.card-primary::before{
  content: url(../images/popular.svg);
  width: 35px;
  display: inline-block;
  position: absolute;
  top: 0;
  right: 5%;
}

.card .list-tick {
  font-weight: 500;
}    
.month{
  position: absolute;
  left: 10rem;
  top: 4rem;
}

.pbottom{
  margin-bottom: 0;
  justify-content: left;
  position: relative;
  vertical-align: bottom;
}
.big{
  font-size: 6rem;
  margin-bottom: 0;
}
.pbold{
  font-weight: 600;
  margin-bottom: 0;
  justify-content: left;
}
.psmall{
  font-size: 2rem;
  justify-content: left;
}
.card-badge{
  margin-left: 2rem;
  text-transform: uppercase;
  font-size: 1.6rem;
  position: absolute;
  left: 18rem;
  top: 2rem;
  
}
 /*grid*/

.grid{
  display: grid;
}


/*media object*/

.media{
  display: flex;
  padding-bottom: 8rem;
  width: 100%;
  
}
.media-title{

  margin-top: 0;
  color: white;
  font-size: 2.4rem;
}
.media-image{

margin-top: 1rem;
}
.image-author{
align-self:flex-end;
}

.media-image .icon-primery{
