  display: flex;
  width: 100%;
}
.media-total{
  flex-grow: 1;
  width: 0%;
}
.media-bodi-testimonials{
  width: 0;
  flex-grow: 1;
}
/*quotes*/
.quotes-paragraph{
  font-style: italic;
  font-size: 3rem;
  color:#5c5577 ;
}
.author{
  color: var(--color-headings);
  font-size: 3rem;
  font-weight: 700;
  margin-bottom: 0;
  padding-left: 0;
}
.company{
  color: var(--color-body);
  opacity: 40%;
  font-size: 2rem;
  justify-content: left;
  padding-left: 7rem;
}
.quotes-paragraph::before{
  content: open-quote;
}
.quotes-paragraph::after{
  content: close-quote;
}

.media-bodi{
  color: var(--color-body);
  text-align: left;
  
}
.media-bodis{
