/*testimonials*/
.testimonials{
position: relative;
display: flex;
flex-direction: column;
margin: 2.5rem 2rem;
box-shadow: 0 0 20px 10px lightgrey;
border-radius: 1rem;
padding: 2rem 2rem;
width: 100%;
}
.block-testimonials{
  padding-bottom: 20rem;
}
.testimonials-image{
  width: 100%;
}
.testimonials-img{
  position: relative;
  padding: 3rem;
}
.testimonials-img  .icon-container-accent{
  position: absolute;
  top: 5rem;
  right: -2px;
  background-color: var(--color-accent);
  fill: white;
  padding:1.8rem;
  border-radius: 100%;
  justify-content: center;
  align-items: center;
 
}

.media-bodis{
  color: var(--color-body);
  margin-bottom: 0;
}
.image-author{
  margin-top: -0.5rem;
}
.block__header .block__heading-testimonials{
  text-align: center;
} 
.featuresblck{
  padding: 2rem;
}

/*callout*/
.callout{
  
  position: absolute;
  background-color: var(--color-primary);
  border-radius: 1rem;
  display: flex;
  flex-direction: column;
  padding: 6rem;
  margin: 6rem;
}
.callout-text>h3,p{
  color: white;
  display: flex;
  justify-content: center;
  align-self: center;
  text-align: center;
}
.callout-text>h3{
  margin-top: 0;
  font-size: 4rem;
}
.callout>button{
width: 0;
align-self: center;
padding: 3rem;
font-size: 1.8rem;
}


/*collapsible*/
.collapsible{
  padding: 2rem;
}
.coll-header{
  position: relative;
}

.posledendel{
  border-bottom: 0.1rem solid grey;
  
}
.collapsible-header{
  font-size: 3rem;
  margin-top: 0;
  font-size: 2rem;
  color: white;
}

.collapsible-body{
  padding-top: 1.5rem;
  font-size:2.4rem;
  opacity: 0;
  max-height:0;
  overflow: hidden;
  transition: all 0.3s;
  display: none;
  
}
.chevron{
  position: absolute;
  right: 0;
  width: 6rem;
  transform: rotate(-90deg);
  transition: all 0.3s;
}
.collapsible--expanded .chevron{
  transform: rotate(0);

}
.collapsible--expanded .collapsible-body{
display: inline-block;
max-height: 100vh;
opacity: 40%;
}
/*navigation links*/

.navigationlist{
 background-color: black;
  display: flex;
  justify-content: space-between;
  flex-wrap: wrap;
}
.navlist_item{
  padding: 0.5rem ;
