  border-bottom: 1px solid darkgrey;
}

.navnav{
 margin: 0;
 width: 100%;
}

.navicon{
  fill: rgba(245, 245, 245, 0.712);
}
.navlist_item> a{
  margin-top: 2rem;
  color:#d2cfd9;
  opacity: 0.9;
}
.navlist_item>a:hover{
    color: white;
    opacity: 1;
    transition: color 0.3s;

}
  
.navigationlist .collapsible{
    padding: 0;
}
  
.collapsible--expanded .navicon{
  padding: 0;
  fill: white;
  box-shadow: 0 0 0 3px #666;
  border-radius: 0.5rem;
  transition: box-shadow 0.15s;
  cursor: pointer;
}
  
.iconlogo{
    font-size: 3.6rem;
